<template>
  <div>
    중고폰입니다. <br />
    등급: {{ rank }} 이미지: <img src="url" alt="" />
  </div>
</template>

<script>
export default {
  props: ["rank"],
  computed: {
    url() {
      let imgUrl = "";
      switch (this.rank) {
        case "A":
          imgUrl =
            "data:image/jpeg;base64,";
          break;
        case "B":
          imgUrl =
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQaQrOBBozUR_dC0r2UldiCb1XJAIW3oDElBA&usqp=CAU";
          break;
      }
      return imgUrl;
    },
  },
};
</script>

